import{_ as l,c as i,o as t,U as e,jn as a,jo as o}from"./chunks/framework.X4dEEzgO.js";const h=JSON.parse('{"title":"Set-up (Log/Utility)","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"ko/manual/setup/log_utility.md","filePath":"ko/manual/setup/log_utility.md"}'),r={name:"ko/manual/setup/log_utility.md"},s=e('<h1 id="set-up-log-utility" tabindex="-1">Set-up (Log/Utility) <a class="header-anchor" href="#set-up-log-utility" aria-label="Permalink to &quot;Set-up (Log/Utility)&quot;">​</a></h1><h3 id="_1-log" tabindex="-1">1. Log <a class="header-anchor" href="#_1-log" aria-label="Permalink to &quot;1. Log&quot;">​</a></h3><p>로봇 팔의 시스템 로그 상태를 확인할 수 있습니다.</p><p><img src="'+a+'" alt="missing"></p><ol><li><ul><li>가져오기 : 제어박스에 있는 LOG 파일을 태블릿 PC로 가져옵니다.<br></li><li>불러오기 : 제어박스로부터 태블릿 PC로 가져온 LOG 파일을 불러와 출력합니다.</li></ul></li><li><ul><li>All : 모든 로그를 출력합니다.<br></li><li>Infomation : 로그 중 정보에 관련한 내용만 출력합니다.<br></li><li>Warning : 로그 중 경고에 관련한 내용만 출력합니다.<br></li><li>Error : 로그 중 오류에 관련한 내용만 출력합니다.<br></li><li>System : 로그 중 시스템에 관련한 내용만 출력합니다.<br></li><li>Fatal : 로그 중 로봇에 고장과 직접적인 관련이 있는 오류에 관련한 내용만 출력합니다.<br></li><li>User : 로그 중 사용자가 지정한 LOG에 관련한 내용만 출력합니다.<br></li><li>Mail : 로그를 Rainbow Robotics의 고객지원 메일 계정으로 보냅니다. 이때 와이파이가 연결되어 있어야 합니다.</li></ul></li><li><ul><li>제어박스 내부 파일 백업 : 제어박스에 저장된 파일들을 태블릿 PC로 백업합니다.<br></li><li>로봇 팔 가동시간 : 로봇 팔을 운용한 시간을 출력합니다.<br></li><li>제어박스 설정 복사 : 제어박스의 설정을 복사합니다.<br></li><li>제어박스 설정 복구 : 기존 제어박스의 설정을 복구합니다.</li></ul></li><li><ul><li>제어박스 시간대 : 현재 제어박스가 인식하고 있는 시간대를 표현합니다.<br></li><li>System Ver. : 현재 제어박스가 사용하고 있는 UI 버전을 출력합니다.</li></ul></li></ol><h3 id="_2-utility" tabindex="-1">2. Utility <a class="header-anchor" href="#_2-utility" aria-label="Permalink to &quot;2. Utility&quot;">​</a></h3><p>로봇의 포장 및 비상 복구에 관한 기능을 제공합니다.</p><div class="warning custom-block"><p class="custom-block-title"> 주의</p><ol><li> 비상 관절 복구 기능(Emergency Joint Recovery) 모드 사용 전, 본 기능의 특성과 작동법을 정확히 숙지 후 사용하세요. </li><li> 로봇 운반 / 이송 시 제조사에서 제공한 포장 박스에 포장 자세로 넣어야 합니다. </li></ol></div><p><img src="'+o+'" alt="missing"></p><ol><li><p>로봇을 포장할 때의 자세를 만들 수 있습니다.<br> 이 기능을 사용하기에 앞서 로봇 팔은 활성화 되어있어야 합니다.<br> 이 기능을 사용하기에 앞서 로봇 팔에 부착된 모든 부착물을 제거하세요.<br> 버튼을 누르고 있는 동안 로봇 팔은 포장 자세로 이동합니다.<br> 포장 자세에 도달하면, 포장 자세에 도달하였다는 알람이 뜹니다.</p></li><li><p>축의 기준점을 공장 초기화 상태로 세팅할 수 있습니다. <br> 이 기능은 로봇이 비정상 작동 시 복구를 위한 기능이므로 주의해서 사용해야 합니다.<br></p><p>Step1. 리셋 할 축을 정합니다.<br> Step2. Release 버튼을 눌러 브레이크를 풀어 자유로운 상태로 만듭니다.<br> Step3. 축에 표시된 홈을 정렬하고 리셋 버튼을 눌러 축을 초기화 합니다.</p></li></ol>',10),n=[s];function u(p,_,c,b,m,d){return t(),i("div",null,n)}const y=l(r,[["render",u]]);export{h as __pageData,y as default};
